import { Clan, Members, WarLog, CurrentWar } from '../api'

import WarPerformance from '../components/WarPerformance'

import { Button } from "shards-react";
import moment from 'moment';

const HomePage = (props) => {
  console.log(props)
  return (
    <>
      <header>
        <h1>ClashLondon</h1>
      </header>
      <WarPerformance {...props.warlog}/>
    </>
  )
}

HomePage.getInitialProps = async function() {
  const clan = await Clan()
  // const members = await Members()
  const warlog = await WarLog()
  const currentwar = await CurrentWar()
  return { clan, warlog, currentwar }
}

export default HomePage
